import { Outlet } from 'react-router-dom';
import '../style/Header.css'
import { useContext, useEffect } from 'react';
import { PatientContext } from '../../context/PatientContext';

const Header = () => {

    const { patient, handleGetPatientByUsername } = useContext(PatientContext)

    useEffect(() => {
        const getInfo = async () => {
            const result = await handleGetPatientByUsername("Tzei")
        }
        getInfo()
    }, [])

    return (
        <div className='container'>
            <header className='header_container'>
                <div className='center_y'>
                    <span className='header_title'>
                        App Name
                    </span>
                    <div className='header_search'>
                        <div className='search_form'>
                            <input type='text' className='search_input' />
                            <img src={require('../../assets/search.png')} className='icon_search' />
                        </div>
                    </div>
                </div>
                <div className='center_y'>
                    <span className='header_username'>{patient.username}</span>
                </div>
            </header>
            <Outlet />
        </div>
    )
}

export default Header;
